graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>start</b></td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "target" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>target</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "context" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>context</b></td></tr></table>>, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C"];

  // Edges
  "start" -> "target" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "start" -> "context" [label="stores", labelOverlay="75%", labelhref="#srcLineTBD"];
  "start" -> "target" [label="optional", labelOverlay="75%", labelhref="#srcLineTBD"];
  "start" -> "target" [label="loop", labelOverlay="75%", labelhref="#srcLineTBD"];
  "start" -> "target" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
